import './Header.css';
import tiles from '../../../images/tiles/tile-graphic.png';

import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';

function Header() {
  return (
    <div className="header__bg">
      <Container>
        <Row>
          <Col xs={12} md={8}>
            <h1 className="heading1">Wellfield is building technology that unlocks the future of decentralized finance.</h1>


          </Col>
        </Row>
      </Container>
      <div className="header__graphic">
        <img src={tiles} alt="Tile graphic" />
      </div>
    </div>

  );
}

export default Header;
